p.x:
var $bm_rt;
var e, amp, ar, freq, fr, fr, posOff, seed, spd, hoff, l, h, xr, yr, yoff, aoff, foff, dir, dir, t, x, y;
e = effect('CT Bubbles Controller');
amp = e('Amplitude');
ar = e('Amplitude (+/-)');
freq = e('Frequency');
fr = e('Frequency (+/-)');
if (fr > freq)
    fr = freq;
posOff = e('Position Spread');
seed = e('Seed');
spd = e('Speed (pxl/sec)');
hoff = e('Speed (+/-)');
l = $bm_mul(e('Loop Time (frames)'), thisComp.frameDuration);
h = $bm_mul(spd, l);
seedRandom(seed, true);
xr = random($bm_neg(posOff[0]), posOff[0]);
yr = random($bm_neg(posOff[1]), posOff[1]);
yoff = random($bm_neg(hoff), hoff);
aoff = random($bm_neg(ar), ar);
foff = random($bm_neg(fr), fr);
dir = Math.floor(random(-1, 1));
if (dir == 0)
    dir = 1;
t = thisProperty.propertyGroup(1)(5);
x = $bm_mul($bm_mul(Math.sin($bm_mul($bm_mul($bm_mul(t, $bm_sum(freq, foff)), Math.PI), 2)), $bm_sum(amp, aoff)), dir);
y = $bm_mul($bm_sum(h, yoff), t);
$bm_rt = [
    value[0] + x + xr,
    value[1] - y + yr
];

s.x:
var $bm_rt;
var e, smin, smax, seed, sc, s, t, k, k2;
e = effect('CT Bubbles Controller');
smin = e('Scale Min');
smax = e('Scale Max');
seed = e('Seed');
seedRandom(seed, true);
sc = random(smin, smax);
s = [
    sc,
    sc
];
t = thisProperty.propertyGroup(1)(5);
k = easeOut(t, 0, 0.5, 0, s);
k2 = easeIn(t, 0.5, 1, 0, s);
$bm_rt = [
    k[0] - k2[0],
    k[1] - k2[1]
];

sa.x:
var $bm_rt;
var i, f, e, l, off;
i = thisProperty.propertyGroup(2).propertyIndex;
f = thisComp.frameDuration;
e = effect('CT Bubbles Controller');
l = $bm_mul(e('Loop Time (frames)'), f);
off = $bm_mul($bm_mul(e('Time Offset (frames)'), f), i);
$bm_rt = $bm_div($bm_mod($bm_sub($bm_sub($bm_sum(time, $bm_mul(50, l)), inPoint), off), l), l);

